/div>\r\n		</li>\r\n	</ul>\r\n</div>\r\n<div class=\"web_map_box\">\r\n	<ul class=\"left_nav\">\r\n		<li>\r\n			<span><a href=\"#\">皮肤检测中心</a></span> \r\n		</li>\r\n		<li>\r\n			<span><a href=\"#\">养肤体验馆</a></span> \r\n		</li>\r\n		<li>\r\n			<span><a href=\"#\">易享·花养颜</a></span> \r\n			<div class=\"inner\">\r\n				<a href=\"#\" class=\"current\">线上商城</a><a href=\"#\">线下商城 </a><a href=\"#\">养肤常识堂 </a>\r\n			</div>\r\n		</li>\r\n	</ul>\r\n</div>\r\n<div class=\"web_map_box\">\r\n	<ul class=\"left_nav\">\r\n		<li>\r\n			<span><a href=\"#\">用户中心</a></span> \r\n			<div class=\"inner\">\r\n				<a href=\"#\" class=\"current\">我的订单</a><a href=\"#\">我的购物袋 </a><a href=\"#\">个人资料 </a><a href=\"use-center3.html\">用户密码 </a>\r\n			</div>\r\n		</li>\r\n		<li>\r\n			<span><a href=\"#\">在线客服</a></span> \r\n		</li>\r\n		<li>\r\n			<span><a href=\"#\">常见问题</a></span> \r\n		</li>\r\n		<li>\r\n			<span><a href=\"#\">网站地图</a></span> \r\n		</li>\r\n		<li>\r\n			<span><a href=\"#\">隐私条款</a></span> \r\n		</li>\r\n	</ul>\r\n</div>','','','网站地图','0','1','1384987407','','','','','','','0','http://','网站地图','','','','article_sitemap.dwt');
INSERT INTO `yzl_article` (`article_id`,`cat_id`,`title`,`content`,`author`,`author_email`,`keywords`,`article_type`,`is_open`,`add_time`,`file_url`,`article_thumb`,`article_img`,`original_img`,`article_icon_1`,`article_icon_2`,`open_type`,`link`,`description`,`vedio_link`,`mark`,`define_url`,`define_theme`) VALUES ('84','26','隐私条款','<div class=\"policy_box\">\r\n	<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" class=\"policy_inner ke-zeroborder\">\r\n		<tbody>\r\n			<tr>\r\n				<td height=\"129\">\r\n					<div class=\"inner\">\r\n						<span>登录个人资料</span> \r\n						<p>\r\n							您的个人资料有助于我们辨识或联络您。当您加入会员或参与本站活动、订阅电子报或索取赠品时，会要求您填写一些个人资料，如年龄、性别、职业、电子信箱及地址等，其目的是要增进对您的了解，并提供更佳的服务。\r\n						</p>\r\n					</div>\r\n				</td>\r\n				<td>\r\n					<div class=\"inner\">\r\n						<span>对个人资料的保密</span> \r\n						<p>\r\n							您的个人资料除经您同意或政府机关、法院及其他本站应依法提供之情形者外，绝不贩卖或透露给网站以外的其他人及单位，并严禁内部人员私自使用这些资料。\r\n						</p>\r\n					</div>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					<div class=\"inner inner1\">\r\n						<span>管理个人资讯</span> \r\n						<p>\r\n							本站将提供您浏览与编辑您的个人资讯的权限。当您登录成会员或订阅相关资料时，您可以浏览或编辑您的个人资讯；您必须要先键入您的电子邮件信箱与密码。您可以：\r\n                            a·浏览或修改您先前提供的个人信息。<br />\r\nb·选择要不要收到易张脸所提供的宣传资料。<br />\r\nc·订阅或取消订阅易张脸产品或服务的电子报。\r\n						</p>\r\n					</div>\r\n				</td>\r\n				<td>\r\n					<div class=\"inner inner1\">\r\n						<span>著作权声明</span> \r\n						<p>\r\n							本站所有内容，包括但不限于文字、照片、影像、插图、录音、影音、档案、网站画面的安排、网页设计等素材，均受到相关著作权法律的保障。本网站内容或服务，仅供个人、非商业用途之使用，未经内容著作权人之授权，不得转载、公开播送或公开传输。本网站所刊载之内容，或有提供或建立相关链接供第三人使用，该等链接所指向之网页或资料，均为被链接网站所提供，相关权利为该等网站或合法权利人所有。\r\n						</p>\r\n					</div>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					<div class=\"inner\">\r\n						<span>商标声明</span> \r\n						<p>\r\n							除非另外声明，本站上出现的皆为易张脸的品牌商标。\r\n						</p>\r\n					</div>\r\n				</td>\r\n				<td>\r\n					<div class=\"inner\">\r\n						<span>保证义务免除</span> \r\n						<p>\r\n							本站所有内容由广州欧菲诗化妆品有限公司所提供，我们力求信息的准确性，但请您体谅我们无法担保这些资讯的完全准确性、即时性或完整性。\r\n						</p>\r\n					</div>\r\n				</td>\r\n			</tr>\r\n			<tr class=\"no_border\">\r\n				<td>\r\n					<div class=\"inner\">\r\n						<span>不提供授权</span> \r\n						<p>\r\n							希望本网站能带给您愉悦的浏览经验，并请您了解为保障知识产权，本网站所刊载之内容，或与其他单位合作之内容，我们不提供任何形式的授权。\r\n						</p>\r\n					</div>\r\n				</td>\r\n				<td>\r\n					<div class=\"inner\">\r\n						<span>评论使用声明</span> \r\n						<p>\r\n							广州欧菲诗化妆品有限公司感谢您提供宝贵的使用经验与所有的爱好者一同分享，不管是赞许或是指教，只要您的发言是公正且有建设性的，我们都将公布于官网上，欢迎您留下宝贵的使用心得。\r\n						</p>\r\n					</div>\r\n				</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>','','','','0','1','1384987655','','','','','','','0','http://','privacy_policy','','','','');
INSERT INTO `yzl_article` (`article_id`,`cat_id`,`title`,`content`,`author`,`author_email`,`keywords`,`article_type`,`is_open`,`add_time`,`file_url`,`article_thumb`,`article_img`,`original_img`,`article_icon_1`,`article_icon_2`,`open_type`,`link`,`description`,`vedio_link`,`mark`,`define_url`,`define_theme`) VALUES ('86','17','玫瑰','<div class=\"product_box\">\r\n            <div class=\"pic\"> <img src=\"images/big_rose.jpg\" width=\"435\" height=\"421\"></div>\r\n            <div class=\"explain\">\r\n                <h4><img src=\"images/rose_logo.jpg\" width=\"157\" height=\"45\"></h4>\r\n                <p class=\"couplet\"><img src=\"images/rose-couplet.jpg\" width=\"32\" height=\"105\"></p>\r\n                <div class=\"effect\">\r\n                    <h5>药用功效</h5>\r\n                    <p>活血调经、解郁安神，适用于缓和情绪，平衡内分泌。</p>\r\n                    <h5>美容功效</h5>\r\n                    <p>玫瑰作为养颜圣品早早就活跃于历史舞台，其功效一直备受推崇。尤其突出的是美白、控油、收敛毛孔等，所有美容的花中，玫瑰是当之无愧的冠军。</p>\r\n                    <p>1 保湿滋养，使干燥敏感的肌肤及时恢复水润柔嫩；\r\n                        4 玫瑰香气能舒缓紧致情绪，进而放松心情，给人安心与幸福感，消除压力，进一步提升美肌效果。</p>\r\n                    <p>2 具有收敛、抗菌和镇静舒缓的作用，紧致毛孔、抑制过多油脂分泌，使肌肤细腻清新，不泛油光； </p>\r\n                    <p>3 富含多种维生素、葡萄糖、果糖、柠檬糖等有益人体健康的营养物质，具有延缓衰老的作用，长期使用能使肌肤滋润而富有光泽； </p>\r\n                </div>\r\n            </div>\r\n        </div>','','','','0','1','1384993693','','','','','data/icon/201311/1385023623912606542.jpg','data/icon/201311/1385023623623957956.png','0','http://','','','','','');
INSERT INTO `yzl_article` (`article_id`,`cat_id`,`title`,`content`,`author`,`author_email`,`keywords`,`article_type`,`is_open`,`add_time`,`file_url`,`article_thumb`,`article_img`,`original_img`,`article_icon_1`,`article_icon_2`,`open_type`,`link`,`description`,`vedio_link`,`mark`,`define_url`,`define_theme`) VALUES ('87','17','洋甘菊','<div class=\"product_box\">\r\n            <div class=\"pic\"><img src=\"images/big_num.jpg\" width=\"435\" height=\"421\"></div>\r\n            <div class=\"explain_num\">\r\n                <h4><img src=\"images/num_logo.jpg\" width=\"234\" height=\"53\"></h4>\r\n                <p class=\"couplet\"><img src=\"images/num-couplet.jpg\" width=\"50\" height=\"87\"></p>\r\n                <div class=\"effect\">\r\n                    <h5>药用功效</h5>\r\n                    <p>清凉、镇定、抗敏，能刺激食欲。</p>\r\n                    <h5>美容功效</h5>\r\n                    <p>洋甘菊的使用历史可追溯到公元前。因其具有良好的安抚作用而被喻为\"植物医师\"。取其抗敏舒缓之效，解除肌肤压力，让你的美丽亲近自然，随心绽放。</p>\r\n                    <p>1 洋甘菊又名西洋甘菊，是一年生草本菊科植物，花瓣呈白色细小碎裂状。它具有消炎、止痒、安抚、修护、洁净、醒肤、抗敏等功效，自古以来，就被西方人当作药草植物，除了冲茶饮用、制药之外，它更是美容界现在争相运用的完美舒缓抗敏成分。</p>\r\n                    <p>2 洋甘菊最主要的特点就是温和，因此它最适合婴儿和敏感肌肤使用，适用于修复受损肌肤、皮肤过敏、干裂缺水等。 </p>\r\n                    <p>3 可以温和调理肌肤的敏感症状，以及舒缓晒后及缺水肌肤的不适感，洋甘菊常被用在婴儿清洁保养品中，保护BABY幼嫩的肌肤。</p>\r\n                </div>\r\n            </div>\r\n        </div>','','','','0','1','1384997795','','','','','data/icon/201311/1385026334502540873.png','data/icon/201311/1385026334203867738.png','0','http://','','','','','');
INSERT INTO `yzl_article` (`article_id`,`cat_id`,`title`,`content`,`author`,`author_email`,`keywords`,`article_type`,`is_open`,`add_time`,`file_url`,`article_thumb`,`article_img`,`original_img`,`article_icon_1`,`article_icon_2`,`open_type`,`link`,`description`,`vedio_link`,`mark`,`define_url`,`define_theme`) VALUES ('88','17','雪莲','<div class=\"product_box\">\r\n	<div class=\"pic\">\r\n		<img width=\"435\" height=\"421\" src=\"images/big_lotus.jpg\" /> \r\n	</div>\r\n	<div class=\"explain_lotus\">\r\n		<h4>\r\n			<img width=\"232\" height=\"36\" src=\"images/lotus_logo.jpg\" /> \r\n		</h4>\r\n		<p class=\"couplet\">\r\n			<img width=\"32\" height=\"100\" src=\"images/lotus-couplet.jpg\" /> \r\n		</p>\r\n		<div class=\"effect\">\r\n			<h5>\r\n				药用功效\r\n			</h5>\r\n			<p>\r\n				袪风湿，强筋骨，补肾阳，调经止血。\r\n			</p>\r\n			<h5>\r\n				美容功效\r\n			</h5>\r\n			<p>\r\n				雪莲是高山稀有的名贵药用植物，5年开花，花期7月，果期8月。\r\n			</p>\r\n			<p>\r\n				1 天然的雪莲花中含有黄硐类芦、雪莲内脂、雪莲多糖等。其防晒系数高达到22SPF，远高于15SPF的国内超强度紫外线辐射，可有效地保护皮肤受紫外线侵害，在内服时表现为保健和增强免疫功能，外用时可达到美容、祛斑、延缓皮肤衰老的目的；\r\n			</p>\r\n			<p>\r\n				2 雪莲能调理肠胃，平衡内分泌，花蕊含有丰富的多种维生素，有消炎灭菌作用等功能，正适合治疗青春痘。\r\n			</p>\r\n			<p>\r\n				3 雪莲可加速皮肤新陈代谢，平衡内分泌，自然除火祛斑，减少皱纹，使皮肤保持光泽、丰满、对面部雀斑、肝斑等有良好的疗效，原来使用其他化妆品过敏的人，使用雪莲便不再过敏。\r\n			</p>\r\n		</div>\r\n	</div>\r\n</div>','','','','0','1','1384997813','','','','','data/icon/201311/1385026348902922474.png','data/icon/201311/1385026348133623085.png','0','http://','','','','','');
INSERT INTO `yzl_article` (`article_id`,`cat_id`,`title`,`content`,`author`,`author_email`,`keywords`,`article_type`,`is_open`,`add_time`,`file_url`,`article_thumb`,`article_img`,`original_img`,`article_icon_1`,`article_icon_2`,`open_type`,`link`,`description`,`vedio_link`,`mark`,`define_url`,`define_theme`) VALUES ('95','27','新品上市-玫瑰莹润焕白系列','<p>\r\n	<span style=\"color:#666666;font-family:Microsoft YaHei;\">女人味，静若清池，动如涟漪。朱自清先生有过这样一段对女人的描述：女人有她温柔的空气，如听萧声，如嗅玫瑰，如水似蜜，如烟似雾，笼罩着我们，她的一举步，一伸腰，一掠发，一转眼，都如蜜在流，水在荡……女人的微笑是半开的花朵，里面流溢着诗与画，还有无声的音乐。</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#666666;font-family:Microsoft YaHei;\">“春藏锦绣风吹拆，天染琼瑶日照开。”</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#666666;font-family:Microsoft YaHei;\">最引人入胜的花中之后玫瑰，饱经自然洗礼傲然绽放，堪比顶级丝缎的花瓣下究竟蕴含着何等强韧的能量呢？玫瑰作为养颜圣品，早早就活跃于历史舞台，其功效亦一直被业界所推崇，莹润焕白之功效尤为突出，在日常保湿同时，唤醒肌肤美白新生。</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#666666;font-family:Microsoft YaHei;\">易张脸成功萃取出玫瑰臻萃，100%萃取植物原液，能深入毛孔，深层美白焕亮肌肤。纯天然玫瑰精华呵护，防止肌肤干燥，增加细胞储水量。还原肌肤均匀细腻，为女人的肌肤赋予美丽强韧之生命力，绽放出超越时间长河的优雅。</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#666666;font-family:Microsoft YaHei;\">玫瑰系列产品，只需简单几步，让您的肌肤莹润焕白！早晚洁肤之后，以该系列养肤水舒缓肌肤，为后续护理做好完美准备；再以珍贵高效的养肤精华液、乳液深入渗透肌肤，减少老化，使得肌肤倍加柔嫩光滑；最后以极致奢华的养肤面霜，为肌肤披上一层完美轻盈保护膜，深度激活亮白，让肌肤时刻倍感呵护，养肤睡眠冻膜，让您安享整晚的滋润呵护，适合每天使用。每两天花上15分钟，以焕白面膜淡褪肌肤黯沉，令肌肤深层重生，将花卉护肤功效发挥到极致。</span> \r\n</p>','','','','0','1','1385031818','','images/201312/thumb_img/.jpg','images/201312/goods_img/95_G_1386005026033.jpg','images/201312/source_img/95_G_1386005026633.jpg','','','0','http://','','','','','');
INSERT INTO `yzl_article` (`article_id`,`cat_id`,`title`,`content`,`author`,`author_email`,`keywords`,`article_type`,`is_open`,`add_time`,`file_url`,`article_thumb`,`article_img`,`original_img`,`article_icon_1`,`article_icon_2`,`open_type`,`link`,`description`,`vedio_link`,`mark`,`define_url`,`define_theme`) VALUES ('96','27','新品上市-雪莲逆颜抗衰系列','<span style=\"color:#666666;font-family:Microsoft YaHei;\">谈及美丽，人们就会很自然的想到闭月羞花之貌、沉鱼落雁之容，美丽的容颜当然会让人愉悦、令人羡慕、给人赏心悦目的感觉。但是，美丽就如花之怒放与凋零，是表象的、短暂的，要怎样去抵挡住风霜的侵袭、扛起生活的坎坷、禁住岁月的蹉跎？</span><br />\r\n<span style=\"color:#666666;font-family:Microsoft YaHei;\">易张脸雪莲逆颜抗衰系列，从根本上阻止和逆转皮肤衰老，使肌肤保持年轻状态。100%萃取植物原液，加速皮肤的新陈代谢，减少皱纹，延缓衰老，使皮肤保持光泽丰满。 外“调”内“养”有效唤活肌底细胞，紧致肌、淡化细纹、养出肌肤年轻状态；延缓肌肤老化，深入肌底，为肌肤输送充沛养分，紧紧锁定肌肤内部各种问题，智能化修护肌肤细胞，令肌肤恢复新生；恢复肌肤弹性，去除老化角质，减轻松弛现象，促进真皮层中胶原蛋白的合成，减轻肌肤张力纹。</span><br />\r\n<span style=\"color:#666666;font-family:Microsoft YaHei;\">早晚洁肤之后，以该系列养肤水舒缓肌肤，为后续护理做好完美准备；再以珍贵高效的养肤精华液、乳液深入渗透肌肤，减少老化，使得肌肤倍加柔嫩光滑；最后以极致奢华的养肤面霜，为肌肤披上一层完美轻盈保护膜，让肌肤时刻倍感呵护。每两天花上15分钟，以面膜淡褪肌肤黯沉，令肌肤深层重生，将花卉护肤功效发挥到极致。</span><br />\r\n<span style=\"color:#666666;font-family:Microsoft YaHei;\">优雅女人以全新易张脸雪莲逆颜抗衰系列，为自己带来由内而外的护肤享受，更会惊喜发现自己的魅力因拥有亮白丝缎美肌而愈加璀璨，至美光彩犹如雪莲，粲然夺目，经典高贵。</span>','','','','0','1','1385031829','','images/201312/thumb_img/.jpg','images/201312/goods_img/96_G_1386111382701.jpg','images/201312/source_img/96_G_1386111382661.jpg','','data/icon/201312/1386111240600093307.jpg','0','http://','','','','','');
INSERT INTO `yzl_article` (`article_id`,`cat_id`,`title`,`content`,`author`,`author_email`,`keywords`,`article_type`,`is_open`,`add_time`,`file_url`,`article_thumb`,`article_img`,`original_img`,`article_icon_1`,`article_icon_2`,`open_type`,`link`,`description`,`vedio_link`,`mark`,`define_url`,`define_theme`) VALUES ('97','27','新品上市-洋甘菊清透保湿系列','<span style=\"color:#666666;font-family:Microsoft YaHei;font-size:12px;\">世间最美姿态非花卉莫属，柔美欲滴的花瓣绽放着娇妍风采，精致娴雅的花蕊执守着高贵魅力，傲然而立的身姿诉说着大自然的美丽奥秘，也吸引着爱美的女子以花养颜的奢美爱好。美妍珍卉一直是护肤秘方中的点睛之笔，花蜜、花瓣、根部都是女性留驻青春光彩的能量之源。</span><br />\r\n<span style=\"color:#666666;font-family:Microsoft YaHei;font-size:12px;\">易张脸洋甘菊清透保湿系列产品，100%萃取植物原液，能深入毛孔，滋润平滑肌肤。纯天然洋甘菊精华养护，激活肌肤自我修复和防御机能。源自成片的洋甘菊花中，感受娇嫩柔软的花瓣轻柔抚摸肌肤，使之散发出洋甘菊的香气，带来清爽舒适的感受，不论何时，身处何地，都能为肌肤提供必要的水分，使肌肤明亮动人，洁净清爽，富含一种天然的脂肪酸，可以快速柔软、平滑您的肌肤，尤其适用于敏感肌肤，体验后，肌肤活力加倍。</span><br />\r\n<span style=\"color:#666666;font-family:Microsoft YaHei;font-size:12px;\">洋甘菊是解决皮肤敏感问题的首选植物成分，让您拥有如婴儿般细嫩肌肤！早晚洁肤之后，以该系列养肤水舒缓肌肤，为后续护理做好完美准备；再以珍贵高效的养肤精华液、乳液深入渗透肌肤，减少老化，使得肌肤倍加柔嫩光滑；最后以极致奢华的养肤面霜，为肌肤披上一层完美轻盈保护膜，调节水油平衡，让肌肤时刻倍感呵护。每两天花上15分钟，以面膜淡褪肌肤黯沉，令肌肤深层重生，将花卉护肤功效发挥到极致。</span>','','','','0','1','1385031840','','images/201312/thumb_img/.jpg','images/201312/goods_img/97_G_1386111544188.jpg','images/201312/source_img/97_G_1386111544077.jpg','','','0','http://','','','','','');
