INSERT INTO `yzl_skin_type` (`skin_id`,`skin_mark`,`skin_name`,`skin_feature`,`skin_maintain`,`recommend_goods`,`time`) VALUES ('1','A','敏感性肌肤','1、皮肤表皮薄，细腻白皙，皮脂分泌少，较干燥，微血管明显，皮肤呈现干燥机能减退，角质层保持水份的能力降低，肌肤表面的皮脂膜形成不完全。\r\n2． 接触化妆品或季节过敏后易引起皮肤过敏，出现红、肿、痒。皮肤缺乏光泽，脸颊易充血红肿。\r\n3． 因季节变化而使皮肤容易呈现不稳定的状态。主要症状是搔痒、烧灼感、刺痛、皮肤发痒和出小疹子。\r\n4． 容易受冷风、食物、水质、紫外线、合成纤维、香味、色素等外在环境或物质的影响。\r\n5． 当接触到刺激性物质就会引发肌肤的问题。对阳光、气候、水、植物（花粉）、化妆品、香水、蚊虫叮咬及高蛋白食物都有可能导致过敏。','选择护肤品和化妆品时要谨慎，尽量选择温和性的护肤品','洋甘菊养肤水、薰衣草养肤面霜、玫瑰养肤睡眠冻膜、洋甘菊养肤蚕丝面膜（请在使用前取适量产品涂抹于耳后，如出现红肿刺痛等过敏反应，请勿使用）','0');
INSERT INTO `yzl_skin_type` (`skin_id`,`skin_mark`,`skin_name`,`skin_feature`,`skin_maintain`,`recommend_goods`,`time`) VALUES ('2','B','中性肌肤','其PH值在5-5.6之间，它是健康的理想皮肤，不油腻不干燥富有弹性，不见毛孔，红润有光泽，不容易老化。','中性皮肤是水分和油分处于平衡状态的皮肤，拥有中性皮肤的人往往误认为不重视护理皮肤也可拥有好的肤质。其实夏季应护理皮脂分泌旺盛的T字部位，以免变成混合性皮肤。冬季则全面的防止皮肤干燥。应该视季节的不同进行正确的保养。充分注意饮食和睡眠，保持心情舒畅。','所有产品.按照自己所需要的护理效果及季节变化进行选择即可.','0');
INSERT INTO `yzl_skin_type` (`skin_id`,`skin_mark`,`skin_name`,`skin_feature`,`skin_maintain`,`recommend_goods`,`time`) VALUES ('6','F','极度敏感肌肤','','','目前没有适合您的产品推荐，建议您停止使用目前正在使用的护肤产品（避免对肌肤造成不可挽回的损伤）并去专业的皮肤科医院咨询皮肤科医生进行治疗！','0');
INSERT INTO `yzl_skin_type` (`skin_id`,`skin_mark`,`skin_name`,`skin_feature`,`skin_maintain`,`recommend_goods`,`time`) VALUES ('4','D','混合性肌肤','在面部T区（额、鼻、口、下颌）呈油性，其余部位呈干性。混合性皮肤多见于25-35岁之间的人。我国大部分人都属于此类皮肤。','将皮肤进行分区域和分季的保养','（根据自己的皮肤选择）樱花养肤水、樱花养肤水、桃花养肤精华液、玫瑰养肤面霜、玫瑰养肤睡眠冻膜、兰花养肤眼贴膜、玫瑰养肤蚕丝面膜','0');
INSERT INTO `yzl_skin_type` (`skin_id`,`skin_mark`,`skin_name`,`skin_feature`,`skin_maintain`,`recommend_goods`,`time`) VALUES ('5','E','油性或偏油性肌肤','皮脂分泌旺盛，多数人肤色偏深，毛孔粗大、皮肤油腻光亮，甚至可以出现桔皮样外观，其PH值在5.6-6.6之间，很容易粘附灰尘和污物，引起皮肤的感染与痤疮等。','注意清洁和控油，使肌肤达到水油平衡。','茉莉养肤洁面乳、洋甘菊养肤水、金盏花养肤精华液、薰衣草养肤面霜、荷花养肤面膜泥、百合养肤蚕丝面膜、茉莉养肤蚕丝面膜','0');
INSERT INTO `yzl_skin_type` (`skin_id`,`skin_mark`,`skin_name`,`skin_feature`,`skin_maintain`,`recommend_goods`,`time`) VALUES ('3','C','干性肌肤','皮脂分泌少，皮肤干燥、白皙、缺少光泽，毛孔细小而不明显，并容易产生细小皱纹，毛细血管表浅，易破裂，对外界刺激比较敏感，皮肤易生红斑，其PH值约为5.5-6.0之间，可分为干性缺水和干性缺油两种。','保证皮肤得到充足的水份，宜用不含碱性物质的膏霜型洁肤品。','牡丹养肤洁面乳、菩提养肤水、雪莲养肤精华液、雪莲养肤面霜、雪莲养肤眼贴膜、牡丹养肤蚕丝面膜、玫瑰养肤睡眠冻膜、玫瑰养肤蚕丝面膜','0');
